import React, { useRef } from 'react';
import Viewer from './Viewer';
import HeaderApp from './HeaderApp';

const Proyectos = ({ token, urn, selectedIds, onCameraChange, onSelectionChange }) => {
    const estiloProyectos = {
        backgroundColor: '#D8D8D8', // Color de fondo
        padding: '20px', // Agrega un poco de espacio alrededor del contenido
        height: 'calc(100vh - 64px)', // Altura total de la ventana menos la altura del HeaderApp
        overflowY: 'scroll', // Activa el desplazamiento vertical
    };

    return (
        <div >
            <HeaderApp /> {/* Instancia el componente HeaderApp aqu√≠ */}
           
            <div style={{ position: 'fixed', top: '64px', width: '100%', height: '88%', marginBottom: '30px' }}>
                <Viewer
                    runtime={{ accessToken: token }}
                    urn={urn}
                    selectedIds={selectedIds}
                    onCameraChange={onCameraChange}
                    onSelectionChange={onSelectionChange}
                    ref={refViewer}
                />
               
            </div>
        </div>
    );
};

export default Proyectos;
